import React, { useEffect } from "react";
import Login from "./Login";


export default function Logout (){
    useEffect(() => {
        sessionStorage.clear();
    })

    const { token, setToken } = useToken();
    console.log(token)

    if(!token){
        return <Login setToken={setToken} />
    }
}
